import React from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import { Line } from 'react-chartjs-2';
import {
    Box,
    Button,
    Card,
    CardContent,
    CardHeader,
    Divider,
    useTheme,
    makeStyles,
    colors
} from '@material-ui/core';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import ArrowRightIcon from '@material-ui/icons/ArrowRight';

const useStyles = makeStyles(() => ({
    root: {}
}));

const LineChart = ({ dataset, selector, className, ...rest }) => {
    const classes = useStyles();
    const theme = useTheme();
    const selected = Object.values(dataset[selector])[1]
    console.log(selected)

    // const data = {
    //     labels:,
    //     datasets: [
    //         {
    //         },
    //         {
    //         }
    //     ]
    // }
    selected.sort(function (a, b) { return a.age - b.age; });

    console.log()
    console.log(Object.values(selected))

    let data = {
        "labels": [],
        "datasets": [
            {
                label: "ICU Death Distribution",
                data: [],
            }
        ]
    };

    console.log(data)

    // const cfg = {
    //     type: 'line',
    //     data: {
    //         datasets: [{
    //             data: data,
    //             parsing: {
    //                 xAxisKey: 'age'
    //             }
    //         }, {
    //             data: data,
    //             parsing: {
    //                 yAxisKey: 'value'
    //             }
    //         }]
    //     },
    // }
    const options = {
        animation: false,
        cornerRadius: 20,
        layout: { padding: 0 },
        legend: { display: true },
        maintainAspectRatio: false,
        responsive: true,
        scales: {
            xAxes: [{
                scaleLabel: {
                    display: true,
                }
            }],
            yAxes: [{
                scaleLabel: {
                    display: true,
                }
            }]
        },
        tooltips: {
            backgroundColor: theme.palette.background.default,
            bodyFontColor: theme.palette.text.secondary,
            borderColor: theme.palette.divider,
            borderWidth: 1,
            enabled: true,
            footerFontColor: theme.palette.text.secondary,
            intersect: false,
            mode: 'index',
            titleFontColor: theme.palette.text.primary
        }
    };

    return (

        <Line
            data={data}
            options={options}
        />

    );
};

LineChart.propTypes = {
    className: PropTypes.string
};

export default LineChart;
